import './Features.css';

function Features() {
  return (
    <section className="features">
      <div className="feature-item">
        <h3>Harmony</h3>
        <p>Balance your online experience with our serene designs.</p>
      </div>
      <div className="feature-item">
        <h3>Focus</h3>
        <p>Stay centered and focused with minimalist interfaces.</p>
      </div>
      <div className="feature-item">
        <h3>Nature</h3>
        <p>Reconnect with nature through subtle, organic elements.</p>
      </div>
    </section>
  );
}

export default Features;
